import React from 'react';

function App() {
  return (
    <div>
      <h1>Links</h1>
      <h2><a href="http://www.yea.dev" target="_blank">yea.dev</a> (still under development)</h2>
      <h2><a href="http://www.github.com/concordgrape" target="_blank">github.com/concordgrape</a></h2>
      <hr />
      <h1>About</h1>
      <p>Hi there, welcome to my simple website. Here is where I'll post my project updates</p>
    </div>
  );
}

export default App;
